import React from 'react';
import './App.css';
import TodoList from './component/TodoList'

class App extends React.Component{
  constructor(){
    super();
    this.todoItems = [
      {title: 'Mua bim bim', isComplete: true},
      {title: 'Di da bong'},
      {title: 'Di choi'}
    ];
  }
  render() {
    return (
    <div className="App">
      {
        this.todoItems.map((item, key) => 
          <TodoList key={key} item={item}/>
        )
      }
    </div>
    );
  }
}

export default App;
